--  DDL for View ATNDNVIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "BEETPROJECT1"."ATNDNVIEW" ("SEMESTER", "LCODE", "LNAME", "SID", "SNAME", "CATEGORY", "MAJORNAME", "LPOINT", "LTIME", "ROOM", "CAPACITY", "PID", "PNAME", "ABSENT3", "WEEK1", "WEEK2", "WEEK3", "WEEK4", "WEEK5", "WEEK6", "WEEK7", "WEEK8", "WEEK9", "WEEK10", "WEEK11", "WEEK12", "WEEK13", "WEEK14", "WEEK15", "WEEK16") AS 
  select semester,le.lcode lcode, lname, s.id sid, s.name sname, category, majorname,
lpoint, ltime, le.room, le.capacity, p.id pid, p.name pname, a.absent3, week1, week2, week3, week4, week5, week6,
week7, week8, week9, week10, week11, week12, week13, week14, week15, week16
from student s
join major m using (majorno)
join lapplication la on (s.id=la.id)
join lecture le on (la.lcode = le.lcode)
join professor p on (le.id = p.id)
left join attendance a on (a.lcode=le.lcode)
;
--------------------------------------------------------
--  DDL for View ATNDNVIEW2
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "BEETPROJECT1"."ATNDNVIEW2" ("SEMESTER", "LCODE", "LNAME", "SID", "SNAME", "CATEGORY", "MAJORNAME", "LPOINT", "LTIME", "LROOM", "CAPACITY", "PID", "PNAME", "ABSENT3", "WEEK1", "WEEK2", "WEEK3", "WEEK4", "WEEK5", "WEEK6", "WEEK7", "WEEK8", "WEEK9", "WEEK10", "WEEK11", "WEEK12", "WEEK13", "WEEK14", "WEEK15", "WEEK16") AS 
  select la.semester semester, le.lcode lcode, le.lname lname, s.id sid, s.name sname, le.category category, m.majorname majorname,
le.lpoint lpoint, le.ltime ltime, le.room lroom, le.capacity capacity, p.id pid, p.name pname, absent3, week1, week2, week3, week4, week5, week6, week7, week8, week9,
                       week10, week11, week12, week13, week14, week15, week16
from student s
join major m using (majorno)
left join lapplication la on (s.id=la.id)
join lecture le on (la.lcode = le.lcode)
right join professor p on (le.id = p.id)
left join attendance at on s.id=at.id and le.lcode = at.lcode
group by la.semester, le.lcode, le.lname, s.id, s.name, le.category, m.majorname,
le.lpoint, le.ltime, le.room, le.capacity, p.id , p.name  ,at.absent3, at.week1, at.week2, week3, week4, week5, week6, week7, week8, week9,
                       week10, week11, week12, week13, week14, week15, week16
;
--------------------------------------------------------
--  DDL for View ATNDNVIEW3
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "BEETPROJECT1"."ATNDNVIEW3" ("SEMESTER", "LCODE", "LNAME", "CATEGORYNAME", "SID", "SNAME", "CATEGORY", "MAJORNAME", "LPOINT", "LTIME", "ROOM", "CAPACITY", "PID", "PNAME") AS 
  select semester,le.lcode lcode, lname, categoryname, s.id sid, s.name sname, category, majorname,
lpoint, ltime, le.room, le.capacity, p.id pid, p.name pname
from student s
join major m using (majorno)
join lapplication la on (s.id=la.id)
join lecture le on (la.lcode = le.lcode)
left join professor p on (le.id = p.id)
;
--------------------------------------------------------
--  DDL for View LSCOREVIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "BEETPROJECT1"."LSCOREVIEW" ("RECEPTIONNO", "SID", "SNAME", "CATEGORYNAME", "MAJORNAME", "SEMESTER", "LCODE", "LNAME", "CATEGORY", "LPOINT", "RETAKE", "ATNDNSCORE", "MIDSCORE", "FINALSCORE", "TOTALSCORE", "GRADE", "PID", "PNAME", "CAPACITY") AS 
  select receptionno, s.id sid, s.name sname, categoryname, majorname, semester, le.lcode , lname, category, lpoint, retake,
ATNDNSCORE, MIDSCORE, FINALSCORE, TOTALSCORE, GRADE, le.id pid, p.name pname, le.capacity
from student s
join major using (majorno)
join lecturescore ls on (s.id=ls.id)
join lapplication la using (receptionno)
join lecture le on (le.lcode=ls.lcode)
join professor p on (le.id=p.id)
;
--------------------------------------------------------
--  DDL for View TERMSCOREVIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "BEETPROJECT1"."TERMSCOREVIEW" ("SEMESTER", "SID", "SNAME", "CATEGORYNAME", "MAJORNAME", "TERMAPLPOINT", "TERMGETPOINT", "GRDPOINT", "TGPA") AS 
  select semester, s.id sid, s.name sname, s.categoryname categoryname, majorname, termaplpoint, termgetpoint, grdpoint, tgpa
from student s
join major using (majorno)
join termscore ts on (s.id=ts.id)
;
